    <Router>
      <h1> Bem vindo ao ParkSys</h1>
      <Link>
        <Button variant="primary">Cadastro Usuario</Button>
      </Link>
      <Routes>
        <Route path="/usuario" exact element={<Usuario />} />
        <Route path="/veiculo" element={<Veiculo />} />
        <Route path="/busca" element={<Busca />} />
      </Routes>
    </Router>
  );
}

export default App;
